@JamesHarris1u @hilarybennmp Yes, but that wasn't a reversal of their position.

It was exactly what they said in 2016.

Or are you saying people can change their mind?

@JamesHarris1u @hilarybennmp I've given you ample evidence that Vote Leave promised us a trade deal. Even in their campaign leaflet.

You don't like it so you're ignoring it.

So why not provide evidence of any official Vote Leave campaigner advocating no deal during the referendum?

@mrchrisnewton @MarlowBosley @JamesHarris1u @hilarybennmp They both advocated for a Norway style Brexit.

As did Farage, many times.

But you at least agree that no one was talking about "no deal".
